  const [blogs, setBlogs] = React.useState([]);

  useEffect(() => {
    const fetchAllBlogs = async () => {
      // const res = await axios.get("/blogs");
      const res = await fetchBlogs();
      console.log(res);
    }
    fetchAllBlogs();
  },[]);

  return (
    <>
      <Middle />
      <div className='home'>
        <Blogs />
      </div>
    </>
  )
}
